import React, { Component } from 'react';
import Footer from '../component/footer';
import Header from '../component/header';
import "./goland.css";

class Goland extends Component{
    constructor(props){
      super(props); 

      if(props.location.state){
        console.log(props.location.state.landid)
        this.state={
          text:props.location.state.landid
        }
      }else{
        window.location.href='http://localhost:3001/'
      }
    }
    render() {
      return  <div>
      <Header></Header>
        <div className='buyland'>
            <h3>火星第号{this.state.text}拍卖资质申请</h3>
            <label>企业名称：</label><input name='nameid'></input>
            <label>企业注册号：</label><input name='nameid'></input>
            <label>企业地址：</label><input name='nameid'></input>
            <label>开户银行：</label><input name='nameid'></input>
            <label>银行账户：</label><input name='nameid'></input>
            <label>竞标出价：</label><input name='nameid'></input>
        </div>
      <Footer></Footer>
      </div>
    }
}

export default Goland;
